import React from "react";
import Member from "./member/member"
import Grid from '@material-ui/core/Grid';
// import {Container} from "react-bootstrap";
// var member = [{src:"null",name:"Jone Dow"},{src:"null",name:"anonymous"}];

const Team = props =>{
    var member = [{src:"null",name:"Jone Dow"},{src:"null",name:"anonymous"}];

    return (
        <Grid container spacing = {3}>
             member.map(element => (<Grid item xs = {3}><Member src = {element.src} name = {element.name}/></Grid>))
        </Grid>
    );
}

export default Team;
